import React, { useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import "../App.css";

const products = [
  { id: 1, name: "T-Shirt", img: "https://img.freepik.com/premium-psd/flat-lay-realistic-t-shirt-mockup_185216-241.jpg", price: "₹299", rating: 4 },
  { id: 2, name: "Denim", img: "https://img.freepik.com/premium-photo/blue-jean-jacket-with-blue-shirt-front_1162228-7632.jpg", price: "₹699", rating: 5 },
  { id: 3, name: "Jacket", img: "https://cdn.pixabay.com/photo/2017/09/07/04/54/khaki-2723896_1280.jpg", price: "₹999", rating: 3 },
  // Add other products here...
];

const ProductDetails = () => {
  const { id } = useParams();
  const navigate = useNavigate();

  const product = products.find((p) => p.id === parseInt(id));
  const [selectedSize, setSelectedSize] = useState("");

  if (!product) {
    return <p>Product not found</p>;
  }

  const handleSizeChange = (e) => {
    setSelectedSize(e.target.value);
  };

  const handlePlaceOrder = () => {
    if (!selectedSize) {
      alert("Please select a size before placing an order.");
      return;
    }
    alert(`Order placed for ${product.name} - Size: ${selectedSize}`);
  };

  const renderStars = (rating) => {
    return "⭐".repeat(rating);
  };

  return (
    <div className="container py-5">
      <button className="btn btn-secondary mb-4" onClick={() => navigate(-1)}>
        ← Go Back
      </button>
      <div className="row">
        <div className="col-md-6">
          <img src={product.img} alt={product.name} className="img-fluid" />
        </div>
        <div className="col-md-6">
          <h2>{product.name}</h2>
          <h3>Price: {product.price}</h3>
          <p><strong>Description:</strong> This is a detailed description of the {product.name}. High-quality, comfortable, and stylish.</p>

          <div className="mt-3">
            <strong>Rating:</strong>{" "}
            <span style={{ fontSize: "20px" }}>{renderStars(product.rating || 0)}</span>
          </div>

          <div className="mt-3">
            <label htmlFor="size">Select Size:</label>
            <select
              id="size"
              value={selectedSize}
              onChange={handleSizeChange}
              className="form-select"
            >
              <option value="">--Select Size--</option>
              <option value="S">Small</option>
              <option value="M">Medium</option>
              <option value="L">Large</option>
              <option value="XL">X-Large</option>
            </select>
          </div>

          <div className="mt-4">
            <p>🚚 <strong>Free Shipping</strong> on all orders</p>
            <p>🔁 <strong>7 Days Return & Exchange</strong> available</p>
          </div>

          <div className="mt-3">
            <button className="btn btn-grad" onClick={handlePlaceOrder}>
              Place Order
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProductDetails;
